import Header from './Header'
document.body.style.backgroundColor = "#F9F9F9";

export default function Layout(props) {
  return (
    <div>
      {props.children}
      <style jsx global>{`
        body {
          background: #F9F9F9;
        }
      `}</style>
    </div>
  )
}
